import { useMemo } from "react";
import "./Poster3.css";
const Poster3 = ({
  poster3BorderRadius,
  poster3Position,
  poster3FlexShrink,
}) => {
  const poster3Style = useMemo(() => {
    return {
      borderRadius: poster3BorderRadius,
      position: poster3Position,
      flexShrink: poster3FlexShrink,
    };
  }, [poster3BorderRadius, poster3Position, poster3FlexShrink]);

  return (
    <div className="poster-3" style={poster3Style}>
      <div className="poster-3-child" />
      <img className="poster-3-item" alt="" src="/undefined11.png" />
      <img className="poster-3-inner" alt="" src="/undefined11.png" />
      <img className="poster-3-child1" alt="" src="/undefined11.png" />
      <img className="poster-3-child2" alt="" src="/undefined12.png" />
      <img
        className="wavy-bus-42-single-03-1-icon"
        alt=""
        src="/undefined13.png"
      />
      <img className="poster-3-child3" alt="" src="/undefined14.png" />
      <div className="accessories-parent">
        <div className="accessories">Accessories</div>
        <div className="check-them-out">Check them Out</div>
      </div>
    </div>
  );
};

export default Poster3;
